const NavBar = () => {
  return(
  <nav className="navbar navbar-expand-lg navbar-light bg-light">
   <div id="nav-icon4">
   <span></span>
  <span></span>
  <span></span>

   </div>

  <div class="collapse navbar-collapse" id="navbarSupportedContent">
    <Link className="nav-link text-uppercase" to={'/'}>Home</Link>
  </div>
  </nav>
  )
}

export default NavBar;
